/**
 * Fetches entries from the API.
 * @returns {Promise<{ id: number; name: string }[]>} Promise that resolves to an array of objects representing entries.
 */
export const fetchEntries = () => {
    // Mock API call
    return new Promise(resolve => {
      setTimeout(() => {
        resolve([
          { id: 1, name: 'Entry 1' },
          { id: 2, name: 'Entry 2' },
          // Add more mock data as needed
        ]);
      }, 500);
    });
  };
